package com.facebook.efun;

public class InviteFriend {

	public InviteFriend() {
		// TODO Auto-generated constructor stub
	}
	
	
	private String name;
	private String id;
	
	private InviteFriendPicture inviteFriendPicture;

	/**
	 * @return the name
	 */
	public String getName() {
		return name;
	}

	/**
	 * @param name the name to set
	 */
	public void setName(String name) {
		this.name = name;
	}

	/**
	 * @return the id
	 */
	public String getId() {
		return id;
	}

	/**
	 * @param id the id to set
	 */
	public void setId(String id) {
		this.id = id;
	}

	/**
	 * @return the inviteFriendPicture
	 */
	public InviteFriendPicture getInviteFriendPicture() {
		return inviteFriendPicture;
	}

	/**
	 * @param inviteFriendPicture the inviteFriendPicture to set
	 */
	public void setInviteFriendPicture(InviteFriendPicture inviteFriendPicture) {
		this.inviteFriendPicture = inviteFriendPicture;
	}
	

}
